const tasks = [
    {
        id:1,
        text:'do presentation',
        day: 'sunday',
        reminder: false
    },
    {
        id:1,
        text:'do live coding',
        day: 'tuesday',
        reminder: false
    },
    {
        id:1,
        text:'attend meeting',
        day: 'wednesday',
        reminder: false
    }
]

const Tasks = () => {
  return (
    <>
      {tasks.map((task) =>
        <h3>{task.text}</h3>
      )}
    </>
  )
}

export default Tasks
